import React from 'react';
import {Nav,NavbarContainer,NavLogo} from './Navbar.Elements'
import {BrowserRouter as Router,Switch, Route } from 'react-router-dom';



function App() {
  return (
   <>
  <Nav>
    <NavbarContainer>
      <NavLogo to='/'>
        MESH
        </NavLogo>
      </NavbarContainer>
  </Nav>
   </>
  );
}

export default App;
